import React from "react";

import "./checkoutPage.scss";

const CheckoutPage = () => (
  <div className='checkout-container'>
    <div className='checkout-header'>
        <div className='block'><span>Product</span></div>
        <div className='block'><span>Name</span></div>
        <div className='block'><span>Quantity</span></div>
        <div className='block'><span>Price</span></div>
        <div className='block'><span>Remove</span></div>
    </div>
    <div className='total'><span>Total</span></div>
  </div>
);
export default CheckoutPage;
